member.example:
using System;
using AjaxPro;

namespace Demo
{
	internal class WebForm1 : System.Web.UI.Page
	{
		private void Page_Load(object sender, System.EventArgs e)
		{
			string json = "[1,2,3,4,5,6]";

			object o = JavaScriptDeserializer.Deserialize(json, typeof(int[]);

			if(o != null)
			{
				foreach(int i in (int[])o)
				{
					Response.Write(i.ToString());
				}
			}
		}
	}
}

member.summary:
This Attribute must be used to create a AJAX wrapper.

public class Test
{
	[AjaxPro.AjaxMethod]
	public string HelloWorld(string username)
	{
		return "Hello " + username;
	}

	[AjaxPro.AjaxMethod(AjaxPro.HttpSessionStateRequirement.ReadWrite)]
	public bool SessionValueIsSet(string key)
	{
		return System.Web.HttpContext.Current.Session[key] != null;
	}
}

member.example:
using System;
using AjaxPro;

namespace Demo
{
	internal class AjaxMethods : IContextInitializer
	{
		private HttpContext context = null;

		public void InitializeContext(HttpContext context)
		{
			this.context = context;
		}

		[AjaxMethod]
		public string GetRootPath()
		{
			return context.Server.MapPath("~");
		}
	}
}

